import { TemplateKind } from '@console/internal/module/k8s';

const iconMap = {
  'icon-linux':
    'data:image/png;base64,',
  'icon-debian':
    'data:image/png;base64,',
  'icon-bsd':
    'data:image/png;base64,',
  'icon-windows':
    'data:image/png;base64,',
  'icon-rhel':
    'data:image/png;base64,',
  'icon-opensuse':
    'data:image/png;base64,',
  'icon-ubuntu':
    'data:image/png;base64,',
};

export const getTemplateOSIcon = (template: TemplateKind): string => {
  const icon = template.metadata.annotations.iconClass;
  return iconMap[icon] || iconMap['icon-linux'];
};
